import './App.css';
import Signup from './Signup';

function App() {
  const getInfo = {
    valid: false,
    firstName: "",
    lastName: "",
    email: "",
    favSeason: ""
  } 
  return (
    <Signup info={getInfo}></Signup>
  );
}

export default App;
